import { Route, Routes } from "react-router-dom";
import AllQuotes from "./pages/AllQuotes";
import newQuote from "./pages/newQuote";
import QuoteDetails from "./pages/QuoteDetails";
function App() {
  return (
    <Routes>
      <Route path="/allquote" element={<AllQuotes/>}></Route>
      <Route path="/allqoute/:qouteid" element={<newQuote/>}></Route>
      <Route path="/quotedetails" element={QuoteDetails}></Route>
    </Routes>
  );
}

export default App;
